import React from "react";
import styled from "styled-components";

const Section = styled.section`
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
`;
const Result = ({ city }) => {
    return (
        <Section>
            <h2>{city}</h2>
            <h4>Mon, 8:12 am</h4>
        </Section>
    );
};

export default Result;
